__declspec(dllexport) void __stdcall SyndromeCalc16(uint16_t *table, uint16_t *parity_base, uint16_t* samples, int n)
{
	const int npar = 16;
	int i;
	for (i = 0; i < n; i++)
	{
		uint16_t* parity = parity_base + i * npar;
		uint16_t wrlo = parity[0] ^ samples[i];
		uint16_t* ptiblo0 = table + (wrlo & 255) * npar * 2;
		uint16_t* ptiblo1 = table + (wrlo >> 8) * npar * 2 + npar;
		((uint64_t*)parity)[0] = ((uint64_t*)(parity + 1))[0] ^ ((uint64_t*)ptiblo0)[0] ^ ((uint64_t*)ptiblo1)[0];
		((uint64_t*)parity)[1] = ((uint64_t*)(parity + 1))[1] ^ ((uint64_t*)ptiblo0)[1] ^ ((uint64_t*)ptiblo1)[1];
		((uint64_t*)parity)[2] = ((uint64_t*)(parity + 1))[2] ^ ((uint64_t*)ptiblo0)[2] ^ ((uint64_t*)ptiblo1)[2];
		((uint64_t*)parity)[3] = (((uint64_t*)(parity))[3] >> 16) ^ ((uint64_t*)ptiblo0)[3] ^ ((uint64_t*)ptiblo1)[3];
	}
}

uint16_t encodeTable[];

__declspec(dllexport) void __stdcall SyndromeCalc16AVX(uint16_t *table, uint16_t *parity_base, uint16_t* samples, int n)
{
	const int npar = 16;
	int i;
	for (i = 0; i < n; i++)
	{
		uint16_t* parity = parity_base + i * npar;
		__m256i temp0 = _mm256_loadu_si256((__m256i*)(parity + 1));
		uint16_t wrlo = parity[0] ^ samples[i];
		uint16_t* ptiblo0 = encodeTable + (wrlo & 255) * npar * 2;
		uint16_t* ptiblo1 = encodeTable + (wrlo >> 8) * npar * 2 + npar;
		__m256 temp1 = _mm256_load_ps((float*)ptiblo0);
		__m256 temp2 = _mm256_load_ps((float*)ptiblo1);
		temp0.m256i_i16[npar-1] = 0;
		temp1 = _mm256_xor_ps(_mm256_castsi256_ps(temp0), _mm256_xor_ps(temp1, temp2));
		_mm256_storeu_ps((float*)parity, temp1);
		//_mm256_stream_ps((float*)parity, temp1);
	}
	_mm256_zeroupper();
}

__declspec(dllexport) void __stdcall SyndromeCalc16AVX1(uint16_t *table, uint16_t *parity_base, uint16_t* samples, int n)
{
	const int npar = 16;
	int i;
	for (i = 0; i < n; i++)
	{
		uint16_t* parity = parity_base + i * npar;
		__m128i lo = _mm_loadu_si128((__m128i*)parity);
		__m128i hi = _mm_loadu_si128(1 + (__m128i*)parity);
		uint16_t wrlo = lo.m128i_u16[0] ^ samples[i];
		__m256 temp0, temp1, temp2;
		lo = _mm_srli_si128(lo, 2);
		lo.m128i_u16[7] = hi.m128i_u16[0];
		hi = _mm_srli_si128(hi, 2);
		temp0 = _mm256_castsi256_ps(_mm256_insertf128_si256(_mm256_castsi128_si256(lo), hi, 1));
		temp1 = _mm256_load_ps((float*)(encodeTable + (wrlo & 255) * npar * 2));
		temp2 = _mm256_load_ps((float*)(encodeTable + (wrlo >> 8) * npar * 2 + npar));
		temp1 = _mm256_xor_ps(temp0, _mm256_xor_ps(temp1, temp2));
		_mm256_storeu_ps((float*)parity, temp1);
		//_mm256_stream_ps((float*)parity, temp1);
	}
	_mm256_zeroupper();
}

